import React from 'react';

function RoundedTextBox(props) {
  return (
    <input
      type="text"
      style={{
        borderRadius: '5px',
        padding: '10px',
        border: '1px solid gray',
        display: 'block',
        margin: '0 auto',
      }}
      {...props}
    />
  );
}

export default RoundedTextBox;
